import React from "react";
import "./App.css";
function App() {
  const [data, setData] = React.useState(null);
  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data[0]));
  }, []);
  return (
    <div className="App">
      <p>{data.name}</p>
    </div>
  );
}
export default App;
